import React from "react";
import logo from "./logo.svg";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import "./myStyle.css";
import HeaderMenu from "./Components/headermenu";
import Footer from "./Components/footer";
import jquery from "jquery";
window.$ = window.jQuery = jquery;
require("bootstrap");

function App() {
  return (
    <div>

      <div className="fixedHeader">
        <header>
          <HeaderMenu />
        </header>
        <section class="dashboard_sec flexAsColumn">

			<div class="mainWrapperAsContainer dashboardHeader">Dashboard - Business Risk Review +</div>
		</section>
		<div class="riskTypeBar noRisk" data-bind="css:computeRiskCss()">
			<span data-bind="html:CompanyRiskCategory"></span>
		</div>
      </div>

      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default App;
